INSERT INTO `articles` (`id`, `created_at`, `updated_at`, `status`, `name`, `alias`, `text`, `h1`, `title`, `description`, `keywords`, `image`, `show_image`, `views`) VALUES
	(5, 1447090773, 1447091678, 1, 'Что такое «Пантон»?', 'chto-takoe-panton', '<p style="text-align: justify;">Знали ли вы, что цвета коллекций дизайнеры не выбирают самостоятельно? Модные тенденции формируются не на подиумах, а в офисах исследовательского центра. Знакомьтесь, Pantone &ndash; институт цвета, который каждый декабрь провозглашает тренды будущих сезонов.</p>\r\n<p style="text-align: justify;">Pantone&nbsp; - авторитетный источник не только для fashion-индустрии. Его наработки используют графические и интерьерные дизайнеры, модные цвета отражаются в ювелирных украшениях и оттенках губной помады, которыми мы будем краситься. И так уже 40 лет.</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">Специалисты Pantone изучают философию цвета. Каждый год они анализируют источники вдохновения дизайнеров, что бы понять &laquo;чем живет&raquo; мировая общественность.</p>\r\n<h2 style="text-align: justify;">Оттенки 2015</h2>\r\n<p style="text-align: justify;">2015 год &ndash; это период бурного индустриального и технического развития. Но делать акценты на искусственности &ndash; это не для Pantone. Поэтому все трендовые оттенки были почерпнуты из природы. Они мягкие, теплые и нежные &ndash; в стилистике плэнер.</p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p style="text-align: justify;">Кстати, пленэр &ndash; это техника в живописи. Слово создано от французского &laquo;plein&raquo; и &laquo;air&raquo;.</p>\r\n<p style="text-align: justify;">Для пленер характерна натуральность, без прикрас, без постановочного освещения и надуманных образов. Как будто художник вышел утром в лес, прихватив кисточки, краски, мольберт, и начал рисовать.</p>\r\n<p style="text-align: justify;">Проще говоря, все трендовые оттенки года &ndash; очень натуральные и естественные. Они отражают буйство цветущего сада, мгновения закатов, прозрачность воды.</p>\r\n<h2 style="text-align: justify;">Список цветов</h2>\r\n<p style="text-align: justify;">Главный оттенок &ndash; Marsala &ndash; и по цвету, и по названию напоминающий вино из Сицилии. Не менее актуальны:</p>\r\n<ul style="text-align: justify;">\r\n<li>&nbsp; Аквамарин;</li>\r\n<li>&nbsp; Ледниковый серый;</li>\r\n<li>&nbsp; Подводный синий;</li>\r\n<li>&nbsp; Зеленый акриловый (мятный).</li>\r\n</ul>\r\n<p style="text-align: justify;">Есть и вкусные цвета: &laquo;Клубничное мороженное&raquo; или &laquo;Мандарин&raquo;. В общем, если хотите быть в тренде, просто придерживайтесь палитры. Это совсем не сложно, ведь в каждой модной коллекции обязательно найдутся вещи в гамме от Пантон. </p>', 'Что такое «Пантон»?', 'Что такое «Пантон»?', 'Что такое «Пантон»?', 'Что такое «Пантон»?', 'c7c2a25a62c6ef509aee1798ae2ee5f2.jpg', 1, 1);
