INSERT INTO `mail_templates` (`id`, `name`, `subject`, `text`, `updated_at`, `status`, `show`, `sort`) VALUES
	(1, 'Контактная форма ( Администратору )', 'Новое сообщение из контактной формы - сайт {{site}}', '<p>Вам пришло новое письмо из контактной формы с сайта {{site}}!</p>\r\n<p>Имя отправителя: {{name}} ( {{ip}} ).</p>\r\n<p>E-Mail отправителя: {{email}}.</p>\r\n<p>IP отправителя: {{ip}}.</p>\r\n<p>Дата сообщения: {{date}}.</p>\r\n<p>Текст сообщения: {{text}}.</p>\r\n<p>&nbsp;</p>\r\n<p>Письмо сгенерировано автоматически. Пожалуйста не отвечайте на него!</p>', 1446978916, 1, 1, 0),
	(2, 'Письмо после подписки ( Пользователю )', 'Спасибо за подписку! Сайт {{site}}', '<p>Спасибо за подписку на новости и акции на сайте {{site}}.</p>\r\n<p>&nbsp;</p>\r\n<h5><span style="color: #999999;">Для того, что бы отписаться, перейдите по ссылке {{link}}.</span></h5>\r\n<h5><span style="color: #999999;">Письмо создано автоматически. Пожалуйста не отвечайте на него.</span></h5>', 1446978916, 0, 0, 2),
	(3, 'Заказ звонка ( Администратору )', 'Заказ звонка, сайт {{site}}', '<p>Поступил новый заказ звонка с сайта {{site}}!</p>\r\n<p>Данные заказчика:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Имя:</td>\r\n<td>{{name}}</td>\r\n</tr>\r\n<tr>\r\n<td>Номер телефона:</td>\r\n<td>{{phone}}</td>\r\n</tr>\r\n<tr>\r\n<td>IP:</td>\r\n<td>{{ip}}</td>\r\n</tr>\r\n</tbody>\r\n</table>', 1446978916, 0, 0, 1),
	(4, 'Подтверждение регистрации ( Пользователю )', 'Пожалуйста, подтвердите свой почтовый адрес, сайт {{site}}', '<p>Для подтверждения регистрации на сайте {{site}}, перейдите по ссылке:</p>\r\n<p>{{link}}</p>', 1446978916, 0, 0, 3),
	(5, 'Восстановление пароля ( Пользователю )', 'Восстановление пароля', '<p>Уважаемый, пользователь. Вы воспользовались услугой восстановления пароля на сайте {{site}}.</p>\r\n<p>Ваш новый пароль для входа теперь:</p>\r\n<p>{{password}}</p>', 1446978916, 0, 0, 5),
	(6, 'Изменение пароля ( Пользователю )', 'Изменение пароля - {{site}}', '<p>Ув., пользователь! Вы только что изменили пароль на сайте {{site}} на {{password}}!</p>', 1446978916, 0, 0, 4),
	(7, 'Новый коментарий ( Администратору )', 'Новый коментарий', '<p>Оставлен новый комментарий на сайте {{site}}!</p>\r\n<p>Информация о комментарии:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>IP:</td>\r\n<td>{{ip}}</td>\r\n</tr>\r\n<tr>\r\n<td>Имя:</td>\r\n<td>{{name}}</td>\r\n</tr>\r\n<tr>\r\n<td>Город:</td>\r\n<td>{{city}}</td>\r\n</tr>\r\n<tr>\r\n<td>Товар:</td>\r\n<td><a href="{{link}}">{{item_name}}</a></td>\r\n</tr>\r\n<tr>\r\n<td>Комментарий:</td>\r\n<td>{{text}}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>', 1446978916, 0, 0, 14),
	(8, 'Новый быстрый заказ ( Администратору )', 'Новый быстрый заказ', '<p>Только что был совершен быстрый заказ на сайте {{site}}!</p>\r\n<p>Товар: <a href="{{link}}">{{item_name}}</a></p>\r\n<p>Заказчик:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>Номер телефона:</td>\r\n<td>{{phone}}</td>\r\n</tr>\r\n<tr>\r\n<td>IP:</td>\r\n<td>{{ip}}</td>\r\n</tr>\r\n</tbody>\r\n</table>', 1446978916, 1, 1, 8),
	(9, 'Вопрос о товаре ( Администратору )', 'Вопрос о товаре, сайт {{site}}', '<p>Внимание!</p>\r\n<p>Пользователь по имени {{name}} ({{ip}}) задал вопрос по товару <strong><a href="{{link}}">{{item_name}}</a></strong></p>\r\n<p>Вопрос звучит так: {{question}}.</p>\r\n<p>Ответить можно, написав e-mail на почту {{email}}.</p>', 1446978916, 0, 0, 15),
	(10, 'Вопрос о товаре ( Пользователю )', 'Вопрос о товаре, сайт {{site}}', '<p>Ув. {{name}}!</p>\r\n<p>Спасибо за проявленный Вами интерес к товару <a href="{{link}}">{{item_name}}</a>.</p>\r\n<p>Ваш вопрос звучал так: {{question}}</p>\r\n<p>Вы получите ответ на этот e-mail в ближайшие сроки!</p>', 1446978916, 0, 0, 16),
	(11, 'Новый заказ ( Администратору )', 'Новый заказ', '<p>Только что был совершен заказ на сайте {{site}}!</p>\r\n<p>Информация о заказчике и способе доставки:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>IP:</td>\r\n<td>{{ip}}</td>\r\n</tr>\r\n<tr>\r\n<td>Имя:</td>\r\n<td>{{name}}</td>\r\n</tr>\r\n<tr>\r\n<td>Номер телефона:</td>\r\n<td>{{phone}}</td>\r\n</tr>\r\n<tr>\r\n<td>E-mail</td>\r\n<td>{{email}}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Информация о заказе:</p>\r\n<p>{{items}}</p>\r\n<p>Для уточнения деталей перейдите по ссылке {{link_admin}}</p>\r\n<p>&nbsp;</p>', 1453020090, 1, 1, 9),
	(12, 'Новый заказ ( Пользователю )', 'Новый заказ', '<p>Вы только что оформили&nbsp; заказ на сайте {{site}}!</p>\r\n<p>Информация о заказчике и способе доставки:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>IP:</td>\r\n<td>{{ip}}</td>\r\n</tr>\r\n<tr>\r\n<td>Имя:</td>\r\n<td>{{name}}</td>\r\n</tr>\r\n<tr>\r\n<td>Номер телефона:</td>\r\n<td>{{phone}}</td>\r\n</tr>\r\n<tr>\r\n<td>Email</td>\r\n<td>{{email}}</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Информация о заказе:</p>\r\n<p>{{items}}</p>\r\n<p>&nbsp;</p>', 1453020946, 1, 1, 10),
	(13, 'Письмо после регистрации (Пользователю)', 'Регистрация', '<p>Спасибо за регистрацию!</p>\r\n<p>Ваши данные для входа:</p>\r\n<p>Логин - {{email}}</p>\r\n<p>Пароль - {{password}}</p>', 1446978916, 0, 0, 6),
	(15, 'Заказ изменен (Заказчику)', 'Ваш заказ {{id}} был откорректирован!', '<p><span style="text-align: left; font-size: 14px; color: #333333; font-family: Arial;">{{name}}, нам очень жаль.</span></p>\r\n<p><span style="text-align: left; font-size: 14px; color: #333333; font-family: Arial;">Мы вынуждены были изменить состав <span class="il">ваш</span>его <span class="il">заказ</span>а № {{id}}<br /></span></p>\r\n<p><span style="text-align: left; font-size: 14px; color: #333333; font-family: Arial;">Вот как выглядит <span class="il">ваш</span> <span class="il">заказ</span> № {{id}} сейчас:</span></p>\r\n<p>{{items}}</p>\r\n<p><span style="text-align: left; font-size: 14px; color: #333333; font-family: Arial;">Текущая стоимость <span class="il">ваш</span>его <span class="il">заказ</span>а <strong>{{amount}} грн</strong></span></p>\r\n<p><span style="text-align: left; font-size: 14px; color: #333333; font-family: Arial;"><span style="text-align: left; font-size: 14px; color: #333333; font-family: Arial;">Еще раз извините.</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style="text-align: left; font-size: 9px; color: #999999; font-family: Arial;">Сообщение создано автоматически. Пожалуйста не отвечайте на него.</span></p>\r\n<p><span style="text-align: right; font-size: 9px; color: #333333; font-family: Arial;"><span style="color: #999999;">Служба поддержки клиентов {{site}}<br /></span></span></p>\r\n<p>&nbsp;</p>', 1446978916, 1, 1, 11),
	(20, 'Смена статуса заказа на "Отменен"', 'Ваш заказ отменен!', '<p>Здравствуйте, {{name}}!</p>\r\n<p>Ваш заказ №{{id}} отменен!</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #808080;">Спасибо, что Вы есть у нас!</span></p>\r\n<p><span style="color: #808080;">Письмо отправлено автоматически, пожалуйста не отвечайте на него!</span></p>', 1446978916, 1, 1, 12),
	(21, 'Смена статуса заказа на "Выполнен"', 'Ваш заказ выполнен!', '<p>Здравствуйте, {{name}}!</p>\r\n<p>Ваш заказ №{{id}} на сумму {{amount}} успешно выполнен!</p>\r\n<p>&nbsp;</p>\r\n<p><span style="color: #808080;">Спасибо, что Вы есть у нас!</span></p>\r\n<p><span style="color: #808080;">Письмо отправлено автоматически, пожалуйста не отвечайте на него!</span></p>', 1446978916, 1, 1, 13),
	(26, 'Отправка нового пароля пользователю через админ-панель', 'Изменение пароля - {{site}}', '<p>Ув., пользователь!</p>\r\n<p>Ваш пароль на сайте {{site}} был изменен администрацией на {{password}}!</p>', 1446978916, 0, 0, 7);
